import classes from './CourseDashBoardView.module.css';


const CourseDashBoardView =()=>{

return (

<div className={classes.courseDashBoardView}>

   <div className={classes.courseNameDiv}> 
       <i>Subject: Classical Mechanices -I</i>
       <i>Code name: CLM 221</i>

   </div>


    <div className={classes.instructorNameDiv}>
       <i>Instructor: Prof. Seemaahini Pati</i>

    </div>	


    <div className={classes.courseTimenStrenthDiv}>
       <i> Started on: 1st Jan 2022</i>
       <i> Ends on: 30th June 2022</i>
       <i> Students enrolled: 27 </i>

    </div>









</div>
);

}

export default CourseDashBoardView;
